// 914. 卡牌分组
// 给定一副牌，每张牌上都写着一个整数。

// 此时，你需要选定一个数字 X，使我们可以将整副牌按下述规则分成 1 组或更多组：

// 每组都有 X 张牌。
// 组内所有的牌上都写着相同的整数。
// 仅当你可选的 X >= 2 时返回 true。

// 示例 1：

// 输入：[1, 2, 3, 4, 4, 3, 2, 1]
// 输出：true
// 解释：可行的分组是[1, 1]，[2, 2]，[3, 3]，[4, 4]

// 示例 2：

// 输入：[1,1,1,2,2,2,3,3]
// 输出：false
// 解释：没有满足要求的分组。

// 示例 3：

// 输入：[1]
// 输出：false
// 解释：没有满足要求的分组。

// 示例 4：

// 输入：[1,1]
// 输出：true
// 解释：可行的分组是 [1,1]

// 示例 5：

// 输入：[1,1,2,2,2,2]
// 输出：true
// 解释：可行的分组是 [1,1]，[2,2]，[2,2]

let hasGroupsSizeX = (deck) => {
  if (deck.length <= 1) {
    return false
  }
  let result = true
  let min = Number.MAX_SAFE_INTEGER // 存放最小的分组长度 JS中最大的安全整数（2^53 - 1）。
  let por = [] //存放分组的数组
  //1. 组内所有的牌上都写着相同的整数。-> 需要排序
  deck.sort((a, b) => a - b)//sort 对数组元素进行 升序排序 改变原数组

  // 2.将相同的数字分为一组
  for (let i = 0, len = deck.length, tem = []; i < len; i++) {
    // console.log(i)     //0
    tem.push(deck[i])  //[1]
    // console.log(tem + 'tem')
    for (let j = i + 1; j <= len; j++) {
      if (deck[i] == deck[j]) {//当前数字与前一个数字 相等
        // console.log(j + ',' + deck[j])
        tem.push(deck[j]) //将相同的数字放在一起
        // console.log('最后一次', j)
        // if (j == len - 1) {
        //   por.push([].concat(tem))
        // }
      } else {  //当前 deck[j] 与前一个数字不相等
        min = min < tem.length ? min : tem.length
        por.push([].concat(tem))//
        // console.log('push')
        // tem.length = 0 //清空tem
        tem = []
        i = j - 1
        // console.log('adsas', i)
        // i = j
        break
      }
    }
  }
  // console.log(min)
  // return por
  if (min < 2) {
    return false
  }
  if (por.length == 1) {
    return true
  }
  por.every(item => {
    if (item.length % min !== 0) {//不是最小分组长度的整数倍
      result = false
      return false
    }
  })
  return result
};
